import Settings from './settings.js';

export default function getMovableBlock() {
	return [
		{
			position: {x:1, y: 0},
			color: '#00ff00'
		},
		{
			position: {x:1, y: 1},
			color: '#00ff00'
		},
		{
			position: {x:1, y: 2},
			color: '#00ff00'
		},
		{
			position: {x:2, y: 1},
			color: '#00ff00'
		},
	]
}
